import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';

export const NameCard = ({element}) => { 
    const {name, phone} = element
    return (
        <div>
            <Card sx={{ minWidth: 275 }}>
                <CardContent>
                <h3>{name}</h3>
                <h3>{phone}</h3>
                </CardContent>
            </Card>
        </div>
    )
}
